// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./TokenFactory.sol";
import "./Marketplace.sol";
import "./CommissionManager.sol";
import "./TransactionHandler.sol";
import "./AccessControl.sol";

contract ContractManager {
    TokenFactory public tokenFactory;
    Marketplace public marketplace;
    CommissionManager public commissionManager;
    TransactionHandler public transactionHandler;
    AccessControl public accessControl;

    constructor(
        address propertyMarketplaceAddress,
        address tokenFactoryAddress,
        address transactionHandlerAddress,
        uint256 platformCommission,
        uint256 promoterCommission,
        address platformAddress, 
        address promoterAddress
    ) {
        tokenFactory = TokenFactory(tokenFactoryAddress);
        marketplace = new Marketplace();
        commissionManager = new CommissionManager(
            platformCommission, 
            promoterCommission, 
            platformAddress, 
            promoterAddress
        );
        transactionHandler = new TransactionHandler(address(commissionManager));
        accessControl = new AccessControl();
    }
}
